import React from "react";
import './Track.css';

function Track(props) {
    const renderAction = () => {
        if (this.props.isRemoval) {
            return <button className="Track-action">-</button>
        } else {
            return <button className="Track-action">+</button>
        }
    };

    return(
        <div className="Track">
            <div className="Track-information">
                <h3>{props.name}</h3>
                {/* <p>TrackArtist</p> */}
            </div>
            {renderAction}
        </div>
    )
}

export default Track;
